function TeamItem(props) {
    return (
        <div className="teamList__item">
            <figure className="teamList__figure">
                <img src={props.image} alt="no-image" />
            </figure>
            <span>{props.name}</span>
            <span>{props.job}</span>
        </div>
    )
}

export default TeamItem
